import React from 'react'
import { View, Text } from 'react-native'

export default function Tab() {



  return (
    <Tab.Navigator
     screenOptions={{
      headerShown: false,
      tabBarShowLabel: false,
      tabBarStyle: {
        height: 60,
        bottom: 20,
        position: 'absolute',
        left:20,
        right: 20,
        elevation:0,
        borderRadius: 20,
        backgroundColor: '#e1c4ff',
      }
     }}
    >
      <Tab.Screen name="Login" component={LoginScreen} options={{
        tabBarIcon: ({focused}) => (
          <View>
            <AntDesign name="profile" size={30} color={focused ? "rgb(20,20,30)" : "#8e8e93"} />
          </View>
        )
      }}/>
      <Tab.Screen name="Profile" component={ProfileScreen} options={{
        tabBarIcon: ({focused}) => (
          <View>
            <Ionicons name="md-person-circle-outline" size={35} color={focused ? "rgb(20,20,30)" : "#8e8e93"} />
          </View>
        )
      }}/>
    </Tab.Navigator>
  );
}
